import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome, faShoppingBasket, faSearch } from '@fortawesome/free-solid-svg-icons';
import { Link, Router } from 'react-router-dom';

function Navbar() {
    return (
        <Router>
        <div className="navbar">
            <h2 className="logo-holder">Placeholder.</h2>
            <ul className="nav-links">
                <li><FontAwesomeIcon icon={faSearch} size="2x"/></li>
                <li><FontAwesomeIcon icon={faHome} size="2x"/></li>
                <li><FontAwesomeIcon icon={faShoppingBasket} size="2x"/></li>
                <li><Link to='/login'>Log in / <br/> Register</Link></li>
            </ul>

        </div>
        </Router>
    )
}

export default Navbar
